import { Button, Card, CardContent, TextField } from '@material-ui/core';
import React from 'react';
import Box from '@mui/material/Box';
import Center from './Center';
export default function Login() {
    return (
        <Center>
        <Card sx={{ width: 400 }}>
            <CardContent>
                <Box com sx={{
                    "& .MultiTextField-root": {
                        m: 1,
                        width: "90%"

                    }
                }}>
                    <form noValidate autocomplete="off">
                        <TextField
                            label="Email"
                            name="email"
                            variant="outlined" />
                        <TextField
                            label="Name"
                            name="name"
                            variant="outlined" />
                        <Button
                            type="submit"
                            variant="contained"
                            size="large"
                            sx={{ width: "90%" }}>Start</Button>

                    </form>
                </Box>
            </CardContent >
            </Card>
        </Center>
    )
}
